// --- Функции-геттеры (адаптированные) ---
const safeGet = (obj, path, defaultValue = undefined) => {
    // Split path only if it's a string and contains dots
    const keys = typeof path === 'string' ? path.split('.') : [path];
    let current = obj;
    for (const key of keys) {
        if (current === null || current === undefined) return defaultValue;
        // Handle potential single-element arrays from xml2js
        const value = Array.isArray(current[key]) ? current[key][0] : current[key];
        current = value;
    }
    // Return defaultValue if final value is null or undefined
    return (current !== undefined && current !== null) ? current : defaultValue;
};


function getOperationName(code) {
    return safeGet(dictionariesData, `operationCodes.${code}.name`, `Неизвестная операция (${code})`);
}
function getOperationAttributeName(opCode, attrCode) {
    const opCodeStr = String(opCode); const attrCodeStr = String(attrCode);
    if (attrCodeStr === '0') return (opCodeStr === '8') ? safeGet(dictionariesData, `operationCodes.${opCodeStr}.attributes.${attrCodeStr}`, `Сортировка (${attrCodeStr})`) : '-';
    if (attrCodeStr === '-') return '-';
    const attrName = safeGet(dictionariesData, `operationCodes.${opCodeStr}.attributes.${attrCodeStr}`);
    // Handle 'без атрибутов' which might be the value for '-' key if it exists
    return (attrName === 'без атрибутов' || attrName === undefined) ? `Неизв. атрибут (${attrCodeStr})` : attrName;
}
function isOperationFinal(opCode) {
    return safeGet(dictionariesData, `operationCodes.${opCode}.isFinal`, false);
}
function getMailCategoryName(code) {
    return safeGet(dictionariesData, `categoryCodes.${code}`, `Неизвестная категория (${code})`);
}
function getMailRankName(code) {
    return safeGet(dictionariesData, `mailRankCodes.${code}`, `Неизвестный разряд (${code})`);
}
function getPostMarkName(code) { // Для одиночного ID
    return safeGet(dictionariesData, `postMarkCodes.${code}`, `Неизвестная отметка (${code})`);
}
function getPostMarkNamesFromBitmask(postMarkCode) { // Для битовой маски
    try {
        // Ensure input is treated as a number/BigInt, handle potential null/undefined
        const code = BigInt(postMarkCode || 0);
        if (code === 0n) return ["Без отметки"];
        const names = [];
        const marksDict = dictionariesData.postMarkCodes || {};
        for (const key in marksDict) {
            // Skip key '0' explicitly if iterating keys
            if (key === '0') continue;
            try {
                const keyBigInt = BigInt(key);
                // Bitwise AND check
                if ((code & keyBigInt) === keyBigInt) {
                    names.push(marksDict[key]);
                }
            } catch (e) {
                 log('warn', `Skipping non-numeric key in postMarkCodes during bitmask check: ${key}`);
            }
        }
        // Если не нашли конкретных флагов, но код не 0, возвращаем исходный код
        return names.length > 0 ? names : [`Неизв. отметка (${postMarkCode})`];
    } catch (e) {
        log('error', `Error processing postMarkCode bitmask ${postMarkCode}: ${e.message}`);
        return [`Ошибка отметки (${postMarkCode})`];
    }
}
function getMailTypeName(code) {
    return safeGet(dictionariesData, `mailTypeCodes.${code}`, `Неизвестный вид (${code})`);
}
function getSenderCategoryName(code) {
    return safeGet(dictionariesData, `senderCategoryCodes.${code}`, `Неизвестная кат. отправителя (${code})`);
}
function getCODEventName(code) {
    return safeGet(dictionariesData, `codEventCodes.${code}`, `Неизвестное событие НП (${code})`);
}
function getCountryNameById(code, lang = 'RU') {
    const country = safeGet(dictionariesData, `countryCodes.${code}`);
    if (!country) return `(${code})`;
    // Fallback to the other language if the preferred one is missing
    return lang === 'EN' ? (country.NameEN || country.NameRU) : (country.NameRU || country.NameEN);
}
function getCountryNameByAlpha2(code2A, lang = 'RU') {
    if (!code2A) return '';
    const country = safeGet(dictionariesData, `countryCodesByAlpha2.${code2A.toUpperCase()}`);
     if (!country) return `(${code2A})`;
    return lang === 'EN' ? (country.NameEN || country.NameRU) : (country.NameRU || country.NameEN);
}

// --- Функции обогащения ---
function enrichHistoryRecord(record) {
     log('debug', `Enriching history record for barcode: ${safeGet(record, 'ItemParameters.Barcode', 'N/A')}`);
    if (!record) return record;
    try {
        // Operation Parameters
        const opParams = record.OperationParameters;
        if (opParams) {
            const opType = opParams.OperType;
            const opAttr = opParams.OperAttr;
            const opTypeId = safeGet(opType, 'Id');
            const opAttrId = safeGet(opAttr, 'Id');
            if (opTypeId !== undefined) {
                opType.Name = getOperationName(opTypeId); // Используем справочник
                opParams.IsFinal = isOperationFinal(opTypeId);
            }
            if (opAttrId !== undefined) {
                opAttr.Name = getOperationAttributeName(opTypeId, opAttrId); // Используем справочник
            } else if (opAttr) { opAttr.Name = '-'; } // Handle case where Attr object exists but ID is missing
        }
        // Item Parameters
        const itemParams = record.ItemParameters;
        if (itemParams) {
            const mailRankId = safeGet(itemParams.MailRank, 'Id');
            const mailTypeId = safeGet(itemParams.MailType, 'Id');
            const mailCtgId = safeGet(itemParams.MailCtg, 'Id');
            if (mailRankId !== undefined) itemParams.MailRank.Name = getMailRankName(mailRankId);
            if (itemParams.PostMark) {
                const marks = Array.isArray(itemParams.PostMark) ? itemParams.PostMark : [itemParams.PostMark];
                let postMarkIdSum = 0n; // Use BigInt for sum
                marks.forEach(mark => {
                    const markId = safeGet(mark, 'Id');
                    if(mark && markId !== undefined) {
                        mark.Name = getPostMarkName(markId); // Получаем имя для конкретного ID
                        try { postMarkIdSum += BigInt(markId); } catch(e){} // Суммируем ID для getPostMarkNamesFromBitmask
                    }
                });
                itemParams.PostMark = Array.isArray(itemParams.PostMark) ? marks : (marks[0] || null);
                // Используем сумму ID (или одиночный ID) для получения списка имен из битовой маски
                itemParams.PostMarkNamesList = getPostMarkNamesFromBitmask(postMarkIdSum || safeGet(itemParams.PostMark, 'Id', 0));
            } else {
                 // Если PostMark отсутствует, устанавливаем значения по умолчанию
                 itemParams.PostMark = { Id: 0, Name: getPostMarkName(0) };
                 itemParams.PostMarkNamesList = ["Без отметки"];
            }
            if (mailTypeId !== undefined) itemParams.MailType.Name = getMailTypeName(mailTypeId);
            if (mailCtgId !== undefined) itemParams.MailCtg.Name = getMailCategoryName(mailCtgId);
        }
         // User Parameters
        const userParams = record.UserParameters;
        if (userParams) {
             const sendCtgId = safeGet(userParams.SendCtg, 'Id');
             if (sendCtgId !== undefined) userParams.SendCtg.Name = getSenderCategoryName(sendCtgId);
        }
        // Address Parameters
        const addrParams = record.AddressParameters;
        if (addrParams) {
            const mailDirectId = safeGet(addrParams.MailDirect, 'Id');
            const countryFromId = safeGet(addrParams.CountryFrom, 'Id');
            const countryOperId = safeGet(addrParams.CountryOper, 'Id');
            if (mailDirectId !== undefined) { addrParams.MailDirect.NameRU = getCountryNameById(mailDirectId, 'RU'); addrParams.MailDirect.NameEN = getCountryNameById(mailDirectId, 'EN'); }
            if (countryFromId !== undefined) { addrParams.CountryFrom.NameRU = getCountryNameById(countryFromId, 'RU'); addrParams.CountryFrom.NameEN = getCountryNameById(countryFromId, 'EN'); }
            if (countryOperId !== undefined) { addrParams.CountryOper.NameRU = getCountryNameById(countryOperId, 'RU'); addrParams.CountryOper.NameEN = getCountryNameById(countryOperId, 'EN'); }
            // Add descriptions if missing but index exists
            if (addrParams.OperationAddress && !addrParams.OperationAddress.Description && addrParams.OperationAddress.Index) addrParams.OperationAddress.Description = `Отделение ${addrParams.OperationAddress.Index}`;
            if (addrParams.DestinationAddress && !addrParams.DestinationAddress.Description && addrParams.DestinationAddress.Index) addrParams.DestinationAddress.Description = `Отделение ${addrParams.DestinationAddress.Index}`;
        }
         // Finance Parameters
         const finParams = record.FinanceParameters;
         if (finParams) {
             const formatCurrency = (val) => (val !== undefined && val !== null) ? (Number(val) / 100).toFixed(2) + ' руб.' : '';
             finParams.ValueFormatted = formatCurrency(finParams.Value);
             finParams.PaymentFormatted = formatCurrency(finParams.Payment);
             finParams.MassRateFormatted = formatCurrency(finParams.MassRate);
             finParams.InsrRateFormatted = formatCurrency(finParams.InsrRate);
             finParams.AirRateFormatted = formatCurrency(finParams.AirRate);
             finParams.RateFormatted = formatCurrency(finParams.Rate);
             finParams.CustomDutyFormatted = formatCurrency(finParams.CustomDuty);
         }
    } catch (enrichError) {
         log('error', `Error during history record enrichment: ${enrichError.message}`, { recordBarcode: safeGet(record, 'ItemParameters.Barcode', 'N/A'), errorStack: enrichError.stack });
         record.enrichmentError = enrichError.message; // Add error flag to record
    }
    return record;
}

function enrichBatchOperation(op) {
    // Batch response attributes often start with '_' after mergeAttrs
    log('debug', `Enriching batch operation: ID=${safeGet(op, 'OperTypeID', 'N/A')}, CtgID=${safeGet(op, 'OperCtgID', 'N/A')}`);
    if (!op) return op;
    try {
        // ** ИСПРАВЛЕНО: Доступ к атрибутам БЕЗ подчеркивания **
        const operId = safeGet(op, 'OperTypeID'); // Атрибут OperTypeID
        const operCtgId = safeGet(op, 'OperCtgID'); // Атрибут OperCtgID

        if (operId !== undefined) {
            // Получаем канонические имена из справочников
            op.OperNameEnriched = getOperationName(operId); // Новое поле для обогащенного имени
            op.OperCtgNameEnriched = getOperationAttributeName(operId, operCtgId); // Новое поле
            op.IsFinal = isOperationFinal(operId); // Добавляем флаг

            // Логируем, если имена из API отличаются от справочника (для отладки)
            if (op.OperName && op.OperName !== op.OperNameEnriched) {
                log('debug', `Batch op name mismatch: API='${op.OperName}', Dict='${op.OperNameEnriched}' for ID=${operId}`);
            }
            if (op.OperCtgName && op.OperCtgName !== op.OperCtgNameEnriched && op.OperCtgNameEnriched !== '-') {
                 log('debug', `Batch op attr name mismatch: API='${op.OperCtgName}', Dict='${op.OperCtgNameEnriched}' for ID=${operId}, CtgID=${operCtgId}`);
            }

        } else {
             log('warn', 'Batch operation missing OperTypeID.');
             // Устанавливаем значения по умолчанию, если ID нет
             op.OperNameEnriched = op.OperName || 'N/A'; // Используем имя из API если есть, иначе N/A
             op.OperCtgNameEnriched = op.OperCtgName || '-'; // Используем имя из API если есть, иначе -
             op.IsFinal = false;
        }
    } catch (enrichError) {
         log('error', `Error during batch operation enrichment: ${enrichError.message}`, { operationId: safeGet(op, 'OperTypeID', 'N/A'), errorStack: enrichError.stack });
         op.enrichmentError = enrichError.message; // Add error flag
         // Устанавливаем значения по умолчанию при ошибке
         op.OperNameEnriched = op.OperName || 'Ошибка обогащения';
         op.OperCtgNameEnriched = op.OperCtgName || '-';
         op.IsFinal = false;
    }
    return op; // Возвращаем модифицированный объект операции
}


module.exports = {
    // Экспортируем геттеры и функции обогащения
    getOperationName, getOperationAttributeName, isOperationFinal,
    getMailCategoryName, getMailRankName, getPostMarkName, getPostMarkNamesFromBitmask,
    getMailTypeName, getSenderCategoryName, getCODEventName,
    getCountryNameById, getCountryNameByAlpha2,
    enrichHistoryRecord, enrichBatchOperation
};

